function getOctoQuadConstant(constantIdentifier) {
  switch (constantIdentifier) {
    case 'OCTOQUAD_CHIP_ID':
      return '0x51';
    case 'SUPPORTED_FW_VERSION_MAJ':
      return '2';
    case 'ENCODER_FIRST':
      return '0';
    case 'ENCODER_LAST':
      return '7';
    case 'NUM_ENCODERS':
      return '8';
    case 'MIN_VELOCITY_MEASUREMENT_INTERVAL_MS':
      return '1';
    case 'MAX_VELOCITY_MEASUREMENT_INTERVAL_MS':
      return '255';
    case 'MIN_PULSE_WIDTH_US':
      return '1';
    case 'MAX_PULSE_WIDTH_US':
      return '0xFFFF';
  }
  return '';
}

function isValidProjectName(projectName) {
  if (projectName) {
    return /^[a-zA-Z0-9 \!\#\$\%\&\'\(\)\+\,\-\.\;\=\@\[\]\^_\{\}\~]+$/.test(projectName);
  }
  return false;
}

function getSparkFunOTOSConstant(constantIdentifier) {
  switch (constantIdentifier) {
    case 'MIN_SCALAR':
      return '0.872';
    case 'MAX_SCALAR':
      return '1.127';
  }
  return '';
}

function getColorConstant(constantIdentifier) {
  switch (constantIdentifier) {
    case 'BLACK':
      return '0xFF000000';
    case 'BLUE':
      return '0xFF0000FF';
    case 'CYAN':
      return '0xFF00FFFF';
    case 'DKGRAY':
      return '0xFF444444';
    case 'GRAY':
      return '0xFF888888';
    case 'GREEN':
      return '0xFF00FF00';
    case 'LTGRAY':
      return '0xFFCCCCCC';
    case 'MAGENTA':
      return '0xFFFF00FF';
    case 'RED':
      return '0xFFFF0000';
    case 'WHITE':
      return '0xFFFFFFFF';
    case 'YELLOW':
      return '0xFFFFFF00';
  }
  return '';
}

