function getWarningForCapabilityRequestedBySample(capability) {
  switch (capability) {
    case 'SWITCHABLE_CAMERA':
      return 'The current configuration does not have multiple webcams.';
    case 'VISION':
      return 'The current configuration has no webcam.';
  }
  return '';
}

